- input: "TEXT\x1CC00071365\x1CX0\x1C\x1CF3XA\x1CThis amendment includes the following
    changes.  Coordinated expenses made on behalf of congressional candidates Cazayoux,
    Cravins and Harlan were done with additional authority turned over to the DSCC
    of Louisiana by the Democratic Congressional Campaign Committee.  All coordinated
    expenditures are now noted and linked to the DCCC.  All totals listed on lines
    11 ai, 11aii, 11c, 12, 21b, 23and 25 have been updated. Receipts from Cazayoux
    for Congress, Charlie Melancon Campaign Committee, Friends of Mary Landrieu, Harlan
    for Congress and Hoyer for Congress were transfers of excess funds and are now
    so noted as a memo text. All disbursements for T-Shirts, Exempt Mail, and volunteer
    exempt mail were not paid with transfer down funds from national affiliated committees.
    \ All expenditures for Campaign Materials, Campaign Paraphernalia-T-Shirts, Exempt
    Mail, Postage, Printing, Party Building communications, Radio Remote, Slate card
    distribution, volunteer exempt mail benefitting federal candidates are on line
    25.  The rest are generic or volunteer exempt, and meet FEC standards to be classified
    as such.  Field and Grassroots Consulting, Organizational/Grassroots Consulting
    and Rental descriptions have been clarified and updated.  Catering, Election Day
    catering, Equipment rental, hall rental were either for generic democratic get
    out the vote or catering and site rentals to organize volunteers for election
    day volunteers or those who were involved with slate card  distribution.  All
    disbursements for Slate Card Distribution on line Schedule H4 meet FEC regulations
    to be on Schedule H4.  These slate cards included at least 3 candidates (names
    and party only) and included no persuasion message or biographical data.  The
    Voter Drive activity year to date totals has been updated.  The contribution from
    Manning Architects, APAC was incorrectly deposited into our Federal Account.  We
    have transferred the money to our Non-Federal account.  This will be reflected
    on our May Monthly report.  The contribution from United Food & commercial Workers
    International has been moved to Line 11(c).  All disbursements from line 21(b)
    that should be on Line 30(b) have been changed.  All disbursements that are reported
    administrative are administrative and are not in connection with a federal candidate
    or election.  Salaries paid on the administrative split are for employees who
    spend less than 25% of their work hours on federal election activity. All payments
    for payroll, payroll taxes and insurance that are reported as administrative are
    not paid on behalf of employees who spend more than 25% of there work time on
    federal election activity.   Salaries reported on line 21b are for employees who
    spend less than 25% of their work hours on federal election activity. All payments
    for payroll, payroll taxes and insurance that are reported on line 21b are not
    paid on behalf of employees who spend more than 25% of there work time on federal
    election activity.  Please note the Louisiana Democratic Party owns it own building
    and therefore does not make regular rent payments.\n"
